(1, 'Abstrak (Ind)', '<p>Abstrak harus mengandung:</p>\r\n\r\n<p>1. Isu latar belakang,<br />\r\n2. Karya2 terdahulu terkait isu,<br />\r\n3. Permasalahan-permasalahan yang ditemukan pada karya-karya terdahulu,<br />\r\n4. Usulan solusi yang dikerjakan di TA ini,<br />\r\n5. Uraian metode yang diusulkan, 6. Hasil2 percobaan. Abstrak ditulis dalam 1 alinea berisi 150 sd 250 kata (1/2 sd 3/4 halaman), Font Times New Roman 12, margin kiri 4 cm, atas bawah kanan 3 cm, spasi 1. Catatan: Abstrak harus ditulis Abstrak dan bukan Abstraksi. Abstrak tidak boleh mengandung kata &quot;akan&quot;.</p>', 1, 'Depan', '1,2,3,4', '2019-06-21 01:11:28', '2019-06-21 01:11:28'),
(2, 'Kata Kunci (Ind)', '<p>3 sd 5 kata, dapat diambil dari kata-kata utama yang kita gunakan dalam Judul dan/atau dalam Abstrak</p>', 1, 'Depan', '1,2,3,4', '2019-06-20 04:06:40', '2019-06-20 04:06:40'),
(4, 'Abstract (Inggris)', '<p>Abstrak harus mengandung: 1. Isu latar belakang, 2. Karya2 terdahulu terkait isu, 3. Permasalahan2 yang ditemukan pada karya2 terdahulu, 4. Usulan solusi yang dikerjakan di TA ini, 5. Uraian metode yang diusulkan, 6. Hasil2 percobaan. Abstrak ditulis dalam 1 alinea berisi 150 sd 250 kata (1/2 sd 3/4 halaman), Font Times New Roman 12, margin kiri 4 cm, atas bawah kanan 3 cm, spasi 1. Catatan: Abstrak harus ditulis Abstrak dan bukan Abstraksi. Abstrak tidak boleh mengandung kata &quot;akan&quot;.</p>', 1, 'Depan', '1,2,3,4', '2019-06-20 04:07:59', '2019-06-20 04:07:59'),
(5, 'Kata Kunci (Inggirs)', '<p>3 sd 5 kata, dapat diambil dari kata-kata utama yang kita gunakan dalam Judul dan/atau dalam Abstrak</p>', 1, 'Depan', '1,2,3,4', '2019-06-20 04:08:14', '2019-06-20 04:08:14'),
(6, 'Daftar Isi', '<p>harus dibuat otomatis (bukan manual) menggunakan Heading dan menu Insert Table of Content</p>', 1, 'Depan', '1,2,3,4', '2019-06-20 04:13:19', '2019-06-20 04:13:19'),
(7, 'Daftar Gambar', '<p>harus dibuat otomatis (bukan manual)</p>', 1, 'Depan', '1,2,3,4', '2019-06-20 04:13:33', '2019-06-20 04:13:33'),
(8, 'Daftar Tabel', '<p>harus dibuat otomatis (bukan manual)</p>', 1, 'Depan', '1,2,3,4', '2019-06-20 04:32:54', '2019-06-20 04:32:54'),
(9, 'Daftar Lampiran', '<p>harus dibuat otomatis (bukan manual)</p>', 1, 'Depan', '1,2,3,4', '2019-06-20 04:33:20', '2019-06-20 04:33:20'),
(10, 'Latar Belakang dan Permasalahan', '<p>==&gt; permasalahan yg muncul di masyarakat (hrs ada rujukan ke daftar pustaka).<br />\r\n==&gt; kerangka pemikiran dlm penyelesaian permasalahan tsb (usulan pengusul).</p>', 3, 'BAB 1', '1,2,3,4', '2019-06-20 06:48:17', '2019-06-20 06:48:17'),
(11, 'Sekilas Karya/Sistem Terdahulu', '<p>Disini diberi kata &quot;sekilas&quot; unt mengartikan singkat dan agar tdk overlaping dgn judul sub bab pada tinjauan pustaka.<br />\r\n==&gt; kendala2 teknis elektronik yg ada dlm penyelesaian masalah di atas (hrs ada rujukab ke daftar pustaka).<br />\r\n&nbsp;==&gt; solusi2 teknis elektronik yg sdh ada dlm menghadapi kendala2 tsb di atas (hrs ada rujukan ke daftar pustaka). Ini merupakan resume singkat pustaka2 terkait yg lbh detilnya ada di bab tinjauan pustaka.</p>', 3, 'BAB 1', '1,2,3,4', '2019-06-20 06:48:23', '2019-06-20 06:48:23'),
(12, 'Karya/Sistem yang Diusulkan', '<p>&nbsp;&nbsp; ==&gt; solusi teknis elektronik yg diusulkan. Baru sebatas prinsipnya saja.<br />\r\n&nbsp;&nbsp; ==&gt; Ilustrasi sistem (ilustrasi dlm bentuk gbr yg komprehensif yg menunjukkan bgm solusi elektronik tsb berinteraksi dgn user unt mempercepat pengertian pembaca)</p>', 3, 'BAB 1', '1,2,3,4', '2019-06-20 06:48:32', '2019-06-20 06:48:32'),
(13, 'Tujuan Terukur dan Luaran yang Hendak Dicapai', '<p>&nbsp;&nbsp; ==&gt; alat/sistem apa yg hendak dibuat. Kaitkan dgn judul unt menjadikan alasan pemilihan judul utama.<br />\r\n&nbsp;&nbsp; ==&gt; luaran yg akan dihasilkan (produk, prototipe, paten, publikasi, dll)<br />\r\nButir2 di atas merupakan janji pengusul yg akan distate capaiannya dan tingkat keberhasilannya dalam bab Kesimpulan).</p>', 3, 'BAB 1', '1,2,3,4', '2019-06-20 06:48:38', '2019-06-20 06:48:38'),
(14, 'Spesifikasi Teknis yang Hendak Dicapai', '<p>&nbsp;==&gt; Berikan batasan2 &quot;parameter/lingkungan internal&quot; sistem yang membatasi permasalahan agar tdk melebar dan tetap fokus. Contoh untuk sistem Transceiver maka spek teknisnya a.l. daya pancar, sensitivitas, jenis modulasi, dll.<br />\r\nBerikan pertimbangan2 unt setiap parameter yg dimunculkan dan nilainya dikaitkan dgn permasalahan2 dan kelemahan solusi2 yg telah dibahas di atas.<br />\r\nButir2 di atas merupakan janji pengusul yg akan distate capaiannya dan tingkat keberhasilannya dalam bab Kesimpulan).</p>', 3, 'BAB 1', '1,2,3,4', '2019-06-20 06:48:44', '2019-06-20 06:48:44'),
(15, 'Ruang Lingkup Permasalahan', '<p>&nbsp;==&gt; Berikan batasan2 &quot;parameter/lingkungan eksternal&quot; sistem yang membatasi permasalahan agar tdk melebar dan tetap fokus. Contoh untuk sistem Transceiver maka ruang lingkupnya a.l. line of sight, jarak 1000 meter, dll.<br />\r\n&nbsp;&nbsp;&nbsp; ==&gt; pembagian topik dgn partner (sehingga terjustifikasi darimana munculnya sub judul).<br />\r\n&nbsp;&nbsp;&nbsp; ==&gt; pembagian lingkup kerja dgn partner.</p>', 3, 'BAB 1', '1,2,3,4', '2019-06-20 06:48:50', '2019-06-20 06:48:50'),
(16, 'Pustaka Terkait', '<p>menjelaskan pustaka-pustaka yang terakit dengan judul namun tidak secara langsung membandingkan metoda/alat/sistem yang diusulkan.<br />\r\nHrs ada rujukan ke daftar pustaka.</p>', 2, 'BAB 2', '1,2,3,4', '2019-06-20 04:34:14', '2019-06-20 04:34:14'),
(17, 'Tabel Perbandingan Pustaka', '<p>&nbsp;&nbsp; ==&gt; Tabel yg meresume perbandingan perbedaan2 yg ada diantara metoda sejenis dan yg diusulkan berikut pnjelasannya (narasinya)<br />\r\nHrs ada rujukan ke daftar pustaka.</p>', 2, 'BAB 2', '1,2,3,4', '2019-06-20 06:52:23', '2019-06-20 06:52:23'),
(18, 'Teori Pendukung', '<p>&nbsp;&nbsp; ==&gt; teori2 yg mendukung ke tahap implementasi atau ke tahap Metodologi Pelaksanaan.<br />\r\n-Maksimal 10 halaman<br />\r\n-Hanya berisi penjelasan teori saja, contoh: teori komunikasi cahaya, teori gelombang radio/cahaya, dll.<br />\r\n-Hrs ada rujukan ke daftar pustaka.<br />\r\n<br />\r\nTeori dan Teknologi JANGAN DIISI DENGAN SPEK TEKNIS ATAU DATASHEET KOMPONEN (misal: ARDUINO, MIKROKONTROLER, MODUL WIFI, dll). Datasheet seperti ini bisa dimasukkan dlm Lampiran saja. Bila ingin membahas Modul Wifi didalam sub bab Teknologi.. ya bahas sj ttg teknologi implementasi Wifi ke dalam suatu Modul seperti apa serta kemajuannya sdh sampai mana dikaitkan dgn topik kita dan jngn membahas ttg Spek Teknis dari suatu modul Wifi unt merek tertentu.<br />\r\n<br />\r\nCatatan: Teori dan Teknologi bisa dibedakan secara mudah sbb: Teori membahas segala sesuatu yg terkait dgn konsep, metoda, perhitungan, rumus, dll. Intinya sesuatu yg blm ada wujudnya. Sedangkan Teknologi segala sesuatu yg membahas ttg &quot;perwujudan&quot; dari suatu teori itu sendiri. Teknologi selalu dikaitkan dgn sesuatu yg berwujud fisik (hasil realisasi/implementasi dari suatu teori/konsep/disain itu sendiri). Jaman sekarang perwujudan/realisasi/implementasi suatu Software bisa masuk dalam bahasan Teknologi.</p>', 2, 'BAB 2', '1,2,3,4', '2019-06-20 06:48:03', '2019-06-20 06:48:03'),
(19, 'Teknologi Pendukung', '<p>&nbsp;&nbsp; ==&gt; teknologi2 yg mendukung ke tahap implementasi atau ke tahap Metodologi Pelaksanaan.<br />\r\n-Maksimal 10 halaman<br />\r\n-Hanya berisi penjelasan tentang teknologi saja, contoh: teknologi GSM, teknologi Card Reader, teknologi modul Wifi, dll).<br />\r\nHrs ada rujukan ke daftar pustaka.</p>', 2, 'BAB 2', '1,2,3,4', '2019-06-20 06:48:10', '2019-06-20 06:48:10'),
(20, 'Perancangan', '<p>Sama halnya dengan bab 3.1 untuk D3, bab 3.1 untuk D4 membahas tentang Blok Diagram, Skema Elektronik, Algoritma dan Flowchart. Perbedaannya adalah untuk D4, ke4 bagian tsb harus dirancang dari nol, sedangkan untuk D3, ke4 bagian tsb bisa mengadopsi dari referensi yang sudah ada dengan menyebutkan sumber pustakanya. Gaya penulisannyapun berbeda, untuk D4 dibahas terlebih dahulu pertimbangan2 pemilihan komponen2 berikut perhitungan nilai-nilainya baru dimunculkan skema elektroniknya sebagai hasil perancangan tsb. Sedangkan untuk D3, skema elektronik (yang berupa gabungan dari beberapa skema dasar) boleh langsung ditampilkan di awal (jangan lupa menyebutkan sumber pustakanya), baru setelah itu membahas cara kerjanya tanpa perlu melakukan proses perancangan sedetil D4. Bilapun ada perhitungan nilai2, namun itu tidak menjadi fokus utama.</p>', 4, 'BAB 3', '1,2,3,4', '2019-06-20 04:33:34', '2019-06-20 04:33:34'),
(21, 'Perancangan Blok Diagram', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; menjelaskan bgm dari ide menjadi blok diagram.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; bila sistem keseluruhan dibagi menjadi bbrp subsistem maka jelaskan terlebih dahulu blok diagram sistem keseluruhan kemudian blok diagram subsistem yg dikerjakan.</p>', 4, 'BAB 3', '1,3', '2019-06-20 04:36:54', '2019-06-20 04:36:54'),
(22, 'Perancangan Algoritma', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; menjelaskan bgm fungsi2 yg akan diimplementasikan dituangkan dalam bentuk algoritma.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; Algoritma biasanya berbentuk kata2 atau kalimat.</p>', 4, 'BAB 3', '2,3', '2019-06-20 04:36:36', '2019-06-20 04:36:36'),
(23, 'Perancangan Diagram Alir', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; menjelaskan bgm dari algoritma menjadi flow chart lengkap yg siap unt di coding.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; Flow Chart biasanya berbentuk kotak2 berisi nama fungsi saling menyambung secara runut dan sistematis dari atas ke bawah.</p>', 4, 'BAB 3', '2,3', '2019-06-20 04:36:21', '2019-06-20 04:36:21'),
(24, 'Simulasi/ Kerealistisan/ Kejelasan dan Keterkaitan (Teori dan Praktis)', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; menjelaskan bgm memvalidasi suatu rancangan hardware (skema elektronik) atau software (flowchart) menggunakan software simulator sehingga terbukti apa yg telah dirancang sdh tepat perhitungan nilai-nilainya. Bila ternyata hasilnya belum tepat maka menjadi masukkan bagi perbaikan perancangan skematik.<br />\r\n==&gt; menjelaskan kerealistisan, kejelasan dan keterkaitan hubungan antara (Teori dan Praktis)&nbsp;&nbsp;</p>', 4, 'BAB 3', '1,2,3,4', '2019-06-20 04:36:06', '2019-06-20 04:36:06'),
(25, 'Realisasi PCB', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; menjelaskan bgm dari skema elektronik menjadi PCB diawali dgn pembuatan Layout berakhir dengan tercetaknya sebuah PCB.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; Tunjukkan foto2 terkait.</p>', 4, 'BAB 3', '1,3,4', '2019-06-20 04:35:45', '2019-06-20 04:35:45'),
(26, 'Realisasi Perakitan', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; menjelaskan bgm dari PCB menjadi sebuah modul elektronik.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; Tunjukkan foto2 terkait.</p>', 4, 'BAB 3', '1,3,4', '2019-06-20 04:35:20', '2019-06-20 04:35:20'),
(27, 'Realisasi Pengkabelan', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; menjelaskan bgm pengkabelan setiap modul dan antar modul sehingga terbentuk sebuah sistem elektronik.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; Tunjukkan foto2 terkait.<br />\r\nHati-hati, pada bab ini akan ditunjukkan Diagram Pengkabelan dan bukan Diagram Skematik. Diagram Pengkabelan tidak sama dengan Diagram Skematik. Bila Skema berisi simbol-simbol komponen yang saling tersambung dengan garis-garis maka Diagram Pengkabelan adalah gambar berisi gambar-gambar nyata modul, komponen, sensor yang saling tersambung dengan kabel.<br />\r\nSkema dapat di &quot;compile&quot; pada sebuah tools software pembuatan Layout PCB, sedangkan diagram pengkabelan tidak. Diagram pengkabelan ada dalam bab Realisasi Pengkabelan.<br />\r\nSkema masuk dalam bahasan perancangan sedangkan Diagram Pengkabelan masuk dalam bahasan Realisasi.</p>', 4, 'BAB 3', '1,3', '2019-06-20 04:35:07', '2019-06-20 04:35:07'),
(28, 'Realisasi Program', '<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; bgm proses pengcodingan flow chart menjadi sebuah program pada berbagai platform yg digunakan (PC, Mikrokontroler, Jaringan, Internet, dll.)<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; tunjukkan potongan2 listing program penting unt dinarasikan.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; listing program lengkap lampirkan di bab lampiran.</p>', 4, 'BAB 3', '2,3', '2019-06-20 04:34:52', '2019-06-20 04:34:52'),
(30, 'Parameter yang Diuji', '<p>==&gt; butir2nya sesuaikan dgn apa yg dijanjikan di Spesifikasi Teknis yg tertera pada sub bab Tujuan.</p>', 4, 'BAB 4', '1,2,3,4', '2019-06-24 03:04:06', '2019-06-24 03:04:06'),
(31, 'Gambaran Situasi Pengujian', '<p>==&gt; jelaskan waktu, tempat, peralatan yg digunakan</p>', 4, 'BAB 4', '1,2,3,4', '2019-06-24 03:04:29', '2019-06-24 03:04:29'),
(32, 'Gambaran Pelaksanaan Pengujian', '<p>==&gt; bagaimana cara melaksanakan pengujian</p>', 4, 'BAB 4', '1,2,3,4', '2019-06-24 03:04:55', '2019-06-24 03:04:55'),
(33, 'Data-Data Pengujian', '<p><strong>&nbsp;&nbsp;&nbsp; </strong>==&gt; sajikan dalam bentuk tabel yg representatif<br />\r\n&nbsp;&nbsp;&nbsp; ==&gt; setiap tabel untuk satu parameter yg diuji.</p>', 4, 'BAB 4', '1,2,3,4', '2019-06-24 03:05:28', '2019-06-24 03:05:28'),
(34, 'Grafik-Grafik Pengujian', '<p>==&gt; ubah data menjadi grafik</p>', 4, 'BAB 4', '1,2,3,4', '2019-06-24 03:05:49', '2019-06-24 03:05:49'),
(35, 'Analisa dan Pembahasan', '<p>==&gt; Tingkat pemahaman mahasiswa terhadap materi tugas akhir:</p>\r\n\r\n<p>1. pengamatan terhadap bentuk grafik dan anomalinya.<br />\r\n2.&nbsp;Bandingkan dgn yang dihasilkan di bagian perancangan dan simulasi (bab 3) atau di teori pendukung (bab 2).<br />\r\n3.&nbsp;Sampaikan hasil analisa/pengamatan, bila terdapat perbedaan sampaikan apa perbedaannya.<br />\r\n4. Sampaikan juga apa penyebab perbedaan tsb dan solusi apa yang dapat dipergunakan untuk memperbaikinya.<br />\r\nCatatan: bila solusi tsb masih dapat diterapkan maka kembali lagi ke proses sebelumnya bila sudah tidak mnkn lagi mengingat keterbatasan keilmuan dan waktu maka biarkan menjadi catatan saran pada bagian Kesimpulan dan Saran.</p>', 4, 'BAB 4', '1,2,3,4', '2019-06-24 03:08:04', '2019-06-24 03:08:04'),
(36, 'Kesimpulan', '<p>==&gt; simpulkan brp persen tingkat keberhasilan alat terhadap keseluruhan sistem seperti yang tercermin pada Judul laporan dan pada juga pada bab Tujuan (bab 1).<br />\r\n==&gt; simpulkan kinerja yang dihasilkan untuk setiap butir spesifikasi teknis yang tertera pada bab 1.<br />\r\n&nbsp;==&gt; bila terdapat sejumlah persentase ketidak berhasilan maka sampaikan apa penyebabnya.</p>', 4, 'BAB 5', '1,2,3,4', '2019-06-24 03:07:28', '2019-06-24 03:07:28'),
(37, 'Saran', '<p>==&gt; berikan saran untuk perbaikan kedepannya.</p>', 4, 'BAB 5', '1,2,3,4', '2019-06-24 03:07:49', '2019-06-24 03:07:49'),
(38, 'Kejelasan analisis intra dan antar komponen TA', NULL, 4, 'BAB 4', '1,2,3,4', '2019-06-24 03:08:33', '2019-06-24 03:08:33'),
(39, 'Capaian sasaran yang telah dibuat dibandingkan dengan tahapan waktu pengerjaan yang ada di proposal (pada laporan TA mahasiswa ditambahkan waktu pengerjaan pada Lampiran)', NULL, 1, 'Lampiran', '1,2,3,4', '2019-06-24 03:09:15', '2019-06-24 03:09:15'),
(40, 'Keterkaitan dan keterpaduan antar Bab (Bagaimana tingkat pemahaman komprehensif (kedalaman, keluasan dan keterpaduan) mahasiswa dalam menuliskan buku TA)', NULL, 4, 'BAB 5', '1,2,3,4', '2019-07-12 02:45:35', '2019-07-12 02:45:35'),
(41, 'Lampiran 1: Datasheet Komponen', '<p>berisi spesifikasi komponen pendukung (hw/sw)<br />\r\nUntuk datasheet hanya bagian utamanya saja bukan seluruh pdfnya dilampirkan.</p>', 1, 'Lampiran', '1,2,3,4', '2019-06-24 03:10:22', '2019-06-24 03:10:22'),
(42, 'Lampiran 2: Skema Lengkap', '<p>berisi skema lengkap sistem</p>', 1, 'Lampiran', '1,2,3', '2019-06-24 03:10:41', '2019-06-24 03:10:41'),
(43, 'Lampiran 3: Listing Program', '<p>Listing program.</p>', 1, 'Lampiran', '2,3', '2019-06-24 03:11:01', '2019-06-24 03:11:01'),
(44, 'Lampiran 4: Tabel Data Primer', '<p><strong>Tabel data primer.</strong></p>', 1, 'Lampiran', '1,2,3,4', '2019-06-24 03:11:20', '2019-06-24 03:11:20');
