(3, '151344025', '0', 'EE089N', 'EE110N', 'PERANCANGAN DAN REALISASI SISTEM KOMUNIKASI DATA SERIAL MENGGUNAKAN MEDIA CAHAYA TAMPAK LAMPU PENERANGAN LED', '2', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-07-12 09:59:28', '2019-07-12 09:59:28'),
(4, '151344016', '0', 'EE031N', '0', 'Perancangan dan Realisasi Test Bed Node Sensor Tersentralisasi Menggunakan Logika Fuzzy Pada Budidaya Jamur Tiram Berbasis Wireless Sensor Network', '2', '<p>Indonesia merupakan negara agraris yang sebagian besar penduduknya bermata pencaharian di bidang pertanian atau bercocok tanam. Oleh sebab itu di Indonesia banyak ditemui lahan perkebunan dan pertanian termasuk lahan persawahan. Di Indonesia, salah satu hasil pertanian yang banyak diminati pasar adalah jamur tiram. Kandungan protein, kalori, zat besi dan vitamin yang terdapat di dalamnya sering digunakan masyarakat sebagai bahan makanan yang sehat dengan rasa yang nikmat. Seperti hasil pertanian lainnya jamur tiram memerlukan suatu kondisi dimana mereka dapat tumbuh dan berkembang dengan baik. Kondisi tersebut tentunya akan sangat mempengaruhi kualitas jamur tiram yang mencakup air, nutrisi, dan kondisi iklim termasuk kelembaban dan suhu lingkungan pertanian. Untuk memenuhi hal tersebut maka dibuatlah suatu tempat yang memenuhi kondisi lingkungan pertanian bernama <em>Greenhouse</em>. <em>Greenhouse</em> yang digunakan untuk pertanian jamur ini biasa disebut dengan kumbung jamur. Salah satu faktor lingkungan yang sangat penting untuk perkembangan jamur tiram adalah suhu dan kelembaban. Untuk membantu petani mengendalikan faktor lingkungan tersebut maka dibuatlah suatu alat monitoring kumbung jamur yang dapat memantau kumbung jamur serta mengendalikan suhu dan kelembaban pada kumbung secara otomatis. Pada sistem ini terdapat beberapa sensor suhu dan kelembaban yang diletakan secara merata pada kumbung jamur. Kemudian dilakukan pengiriman data sensor ke sentral dengan menggunakan sistem <em>Wireless Sensor Network</em> (WSN). Data dikirimkan ke sentral untuk dilakukan pengolahan karena sistem menggunakan sistem kontrol tersentralisasi. Terdapat aktuator untuk menjaga suhu dan kelembaban kumbung seperti lampu pijar, kipas, dan <em>humidifier</em>. Aktuator tersebut dikontrol menggunakan sistem kontrol tersentralisasi sehingga pengontrolan hanya dilakukan pada satu sentral saja untuk semua kumbung jamur. Untuk pengendalian suhu dan kelembaban yang baik maka digunakan logika fuzzy untuk penentu pengontrolan aktuator yang ada.</p>', 'Greenhouse, suhu, kelembaban, Wireless Sensor Network, Logika Fuzzy', '<p><em>Indonesia is an agrarian country where most of the people work in agriculture or grow crops. Therefore, in Indonesia there are many plantations and agricultural areas. In Indonesia, one of the most popular agricultural products in the market is oyster mushrooms. The protein, calories, iron and vitamins contained in it are often used by the community as a healthy food with a delicious taste. Like other agricultural products, oyster mushrooms require a condition where they can grow and develop properly. This condition certainly will greatly affect the quality of oyster mushrooms which include water, nutrients, and climatic conditions including humidity and temperature of the agricultural environment. To fulfill this, a place was made that fulfilled the environmental conditions of the farm called the Greenhouse. The greenhouse used for mushroom farming is commonly called mushroom kumbung. One of the most important environmental factors for the development of oyster mushrooms is temperature and humidity. To help farmers control these environmental factors, a monitoring tool for mushroom kumbung was made which can monitor mushroom kumbung and control temperature and humidity on the mushroom automatically. In this system there are several temperature and humidity sensors that are placed spreadly on the mushroom kumbung. Then the sensor data is sent to the center using the Wireless Sensor Network (WSN) system. Data is sent to the central for processing because the system uses a centralized control system. There are actuators to maintain the temperature and humidity of kumbung such as incandescent lamps, fans and humidifiers. The actuator is controlled using a centralized control system so that control is only carried out on one central for all mushroom kumbung. For good temperature and humidity control, fuzzy logic is used to determine the control of existing actuators.</em></p>', 'Greenhouse, temperature, humidity, Wireless Sensor Network,  Fuzzy Logics', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2019-07-12 14:22:08', '2019-07-12 14:22:08');
