(1, '161331046', 'EE083N', '<p>Abstrak: Latar belakang mengapa dilakukan penelitian ini kurang jelas, studi literatur, shg mendapatkan ide untuk membuat penelitian dengan topik tsb tidak disebutkan. Apa solusi dan keuntungan menggunakan bahan ini tdk disebutkan.</p>\r\n\r\n<p>Bab I: Tidak nampak/disebutkan kelemahan pada penelitian terdahulu, sehingga timbul ide untuk memperbaikinya melalui penelitian/TA yg saudara kerjakan sekarang.&nbsp;</p>\r\n\r\n<p>Tinjauan pustaka: Perlu menyimpulkan kelemahan dan kelebihan feature penelitian terdahulu, sehingga diperoleh hal yg kurang, sehingga kekurangan tersebut akan diperbaiki dengan penelitian saudara. (Posisi Penelitian) ada baiknya dibuat tabel, sehingga mudah membandingkan: Judul, Tujuan, posisi penelitian, metode yang digunakan dan Hasil yg dicapai.&nbsp;</p>\r\n\r\n<p>Frekwensi 5-7 GHz, ada baiknya disesuaikan dengan Judul TA.</p>\r\n\r\n<p>Kesimpulan: no 3 dan 4 itu bukan merupakan kesimpulan</p>', 1, 1, 0, '2019-07-22 05:43:47', '2019-07-22 05:43:47'),
(2, '151344018', 'EE008N', '<p><strong>REVISI</strong></p>\r\n\r\n<p><strong>Abstrak :</strong></p>\r\n\r\n<p>Karya2 terdahulu terkait isu,<strong>tidak ada</strong><br />\r\nPermasalahan-permasalahan yang ditemukan pada karya-karya terdahulu <strong>tidak ada</strong></p>\r\n\r\n<p>dan hasil percobaan atau pengukuran<strong> tidak ada</strong></p>\r\n\r\n<p><strong>Mohon tambahkan kuota jumlah kata bmasih tersedia!!</strong></p>\r\n\r\n<p><strong>Abstrak bhs imggris:&nbsp;</strong>When the accumulation of transportation result in many traffic violations resulting in accident. Created the accindent detection system on fourwheeled v ehicles is a tool thath aims to facilitate fast and accurate information about accidents and provide information in the form of virtual images that help the family know the situation from the car. Information obtained will be sent on a smartphone or android on the family who are equipped with monitoring features.&nbsp;betulkAN GRAMMAR DAN KALIMAAHKAN 2 NYA JANGAN TERJEMAHKAN LANGSUNG IND KE INGGRIS KRN BISA JADI ORANG INGGRIS BAHKAN TIDAK DAPAT MENGERTI BHS INGGRIS KITA.</p>\r\n\r\n<p>KATA KUNCI CUKUP 4 BH SAJA</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><strong>Bab 1.3. Tolong dinyatakan dengan eksplisit diman sdr meletakan GPS device sehingga dapat mendeteksi lokasi kejadian</strong></p>\r\n\r\n<p>Bab 1.4&nbsp;luaran yg akan dihasilkan (produk, prototipe, paten, publikasi, dll ?</p>\r\n\r\n<p>Bab 1.5 Yang ditulis bukan spesifikasi teknis tetapi penjelasan fungsi atau kegunaan alat. Tuliskan spek tekhis yang&nbsp;harus dicapai oleh alat yang dibuat misalnya alat monitor (smart phone) yang digunakan harus jenis android versi .... dengan min kapasitas memorinya brp dan sbg....</p>\r\n\r\n<p>Daftar isi masih banyak :KEPENTINGAN AKADEMIS ....................................................... Error! Bookmark not defined. DAFTAR RIWAYAT HIDUP......................................................... Error! Bookmark not defined. LEMBAR PESEMBAHAN ............................................................. Error! Bookmark not defined. KATA PENGANTAR...................................................................... Error! Bookmark not defined. ABSTRAK ........................................................................................ Error! Bookmark not defined. ABSTRACT...................................................................................... Error! Bookmark not defined.</p>\r\n\r\n<p>LAMPIRAN...................................................................................... Error! Bookmark not defined. Lampiran 1. Datasheet Gyroscope MPU-6050 .......................... Error! Bookmark not defined. Lampiran 2. Datasheet GPS NEO-6 ........................................... Error! Bookmark not defined. Lampiran 3. Datasheet Raspberry Pi 3+.................................... Error! Bookmark not defined. Lampiran 4. Skema Lengkap...................................................... Error! Bookmark not defined. Lampiran 5. Flowchart Sistem Integrasi.................................... Error! Bookmark not defined. Lampiran 6. Program Integrasi Sistem...................................... Error! Bookmark not defined. Lampiran 7. Jadwal Kegiatan Tugas Akhir .............................. Error! Bookmark not defined.</p>\r\n\r\n<p>DAFTAR LAMPIRAN Lampiran 1. Datasheet Gyroscope MPU-6050 .............................. Error! Bookmark not defined. Lampiran 2. Datasheet GPS NEO-6 ............................................... Error! Bookmark not defined. Lampiran 3. Datasheet Raspberry Pi 3+........................................ Error! Bookmark not defined. Lampiran 4. Skema Lengkap.......................................................... Error! Bookmark not defined. Lampiran 5. Flowchart Sistem Integrasi ....................................... Error! Bookmark not defined. Lampiran 6. Program Integrasi Sistem.......................................... Error! Bookmark not defined. Lampiran 7. Jadwal Kegiatan Tugas Akhir .................................. Error! Bookmark not defined</p>\r\n\r\n<p>Tujuan terukur: Misalnya sampai kemiringan berapa derajat masih dapat diukur? Tolong sebutkan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Realisasi Perakitan dan Realisasi Pengkabelan, bisa tidak dibuat single line digram yang menunujukan hubungan kawat anta baian secara gambar manual (lengkap dengan label2nya) bukan gambar FOTO</p>\r\n\r\n<p>Lampiran 4: Tabel Data Primer <strong>TIDAK ADA</strong></p>', 1, 1, 0, '2019-07-22 07:39:28', '2019-07-22 07:39:28'),
(3, '161331030', 'EE008N', '<p><strong>Abstrak:</strong></p>\r\n\r\n<p>Karya2 terdahulu terkait isu,<br />\r\nPermasalahan-permasalahan yang ditemukan pada karya-karya terdahulu,</p>\r\n\r\n<p><strong>Hasil2 percobaan.&nbsp;</strong></p>\r\n\r\n<p><strong>Kata kiunci terlalu banyak, cukup 3 - 4 kata utama</strong></p>\r\n\r\n<p>Abstrak bhs Inggris:</p>\r\n\r\n<p>Secara umum tatabahasa atau grammar dan phrase kalimat dibetulkan spt ,&nbsp;<strong>Radar Altimeter is a device to height of the vertical plane to the ground or sea</strong></p>\r\n\r\n<p><strong>dll.</strong></p>\r\n\r\n<p>The antenna on the radar have a functions to receive or reflect electromagnetic waves and it will be received from an object at the same frequency in one frequency range.</p>\r\n\r\n<p>The final project has design, simulation and realization of&nbsp; ....dst</p>\r\n\r\n<p>Pada Daftar Rumus : masih ada&nbsp;PERSAMAAN 2.3 Perhitungan delta L................ <strong>ERROR! BOOKMARK NOT DEFINED.</strong> PERSAMAAN 2.4 Konstanta Dielektrik Efektif..................................................Error! Bookmark not defined</p>\r\n\r\n<p>Bab 1:</p>\r\n\r\n<p>apakah ada&nbsp;&nbsp;permasalahan yg muncul di masyarakat (yang&nbsp;&nbsp;ada rujukan ke daftar pustaka)</p>\r\n\r\n<p>Latar belakang terlalu panjang tetapi&nbsp;kerangka pemikiran dlm penyelesaian permasalahan tsb (usulan pengusul) kurang tajam. Tlng dipertajam.</p>\r\n\r\n<p>Bab 2:</p>\r\n\r\n<p>Pada teknologimpendukung apakah tidak ada teknologi pendukung selain ANSYS .</p>\r\n\r\n<p>Pada&nbsp;Tabel IV. 14 Tabel perbandingan hasil pengukuran gain. Tidak ada analisa mengapa Gain H Plane berbeda dengan Gain E Plane ? Tolong tambahkan!!</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-30 07:52:58', '2019-07-30 07:52:58'),
(4, '161331004', 'EE008N', '<p>Abstrak :</p>\r\n\r\n<p>&nbsp;Hasil2 percobaan, tidak terlihat pada abstrak apa sdr melakukan percobaan, misal berapa buah kendaraabn yang terpakir dan jenis apa saja dsbikup</p>\r\n\r\n<p>Kata kunci jangan terlalu banyak 4 bh cukup</p>\r\n\r\n<p>ajikan dalam bentuk tabel yg representatif<br />\r\n&nbsp;&nbsp;&nbsp; ==&gt; setiap tabel untuk satu parameter yg diuji.<strong>TIDAK ADA DATA HASIL PENGUJIAN , misalkan Tabel data jumlah slot parkir sebagai fungsi dari waktu</strong></p>\r\n\r\n<p>bah data menjadi grafik, klo data ada maka dapat dibuatkan grafiknya sehingga memudahkan kita melihat kapan puncak jumlah slot parkir yang terisi begitu. TOLONG DIBUATKAN</p>\r\n\r\n<p>Gambar IV-4. Deteksi jumlah slot pada parkiran depan MKU, <strong>GAMBAR SEMACAM INI SULIT UNTUK DIBACA, TINGKATKAN RESOLUSINYA SEHINGGA MUDAH DIBACA</strong></p>\r\n\r\n<p>Lampiran 1: Datasheet Komponen<strong>&nbsp;TIDAK ADA</strong></p>\r\n\r\n<p>Lampiran 2: Skema Lengkap<strong> TIDAK ADA</strong></p>\r\n\r\n<p>Lampiran 4: Tabel Data Primer<strong>TIDAK ADA, MOHON DILENGKAPI LAMPIRAN YG TIDAK ADA TSB!!</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-29 04:00:33', '2019-07-29 04:00:33'),
(5, '161331008', 'EE008N', '<p>Abstrak harus mengandung:</p>\r\n\r\n<p>1. Isu latar belakang,<br />\r\n2. Karya2 terdahulu terkait isu,<br />\r\n3. Permasalahan-permasalahan yang ditemukan pada karya-karya terdahulu,<br />\r\n4. Usulan solusi yang dikerjakan di TA ini,<br />\r\n5. Uraian metode yang diusulkan, 6. Hasil2 percobaan. <strong>MOHON BETULKAN ABSTRAK SPT PANDUAN TSB</strong></p>\r\n\r\n<p>KATA KUNCI&nbsp;apat diambil dari kata-kata utama yang kita gunakan dalam Judul dan/atau dalam Abstrak.</p>\r\n\r\n<p><strong>Sistem Parkir KAYANYA BUKAN KATA UTAMA&nbsp;</strong></p>\r\n\r\n<p>Daftar Tabel <strong>TIDAK ADA</strong></p>\r\n\r\n<p>&nbsp;BAB 1:</p>\r\n\r\n<p>Dalam mengatasi berbagai permasalahan pada sistem parkir banyak pihak meciptakan eksperimen dan penelitian sebagai solusi untuk mengatasi permasalahaan tersebut diantaranya, pada <strong>[]</strong> dan <strong>[] </strong>telah direalisasikan sistem pendeteksi ketersediaan lahan parkir menggunakan sensor LDR dan Ultrasonik. Namun dalam penggunaanya dalam melihat lokasi parkir menggunakan[ ...] <strong>KENAPA PADA KOSONG!!</strong></p>\r\n\r\n<p><strong>Spesifikasi:</strong></p>\r\n\r\n<p>Lahan parkir yang bagian blind spot terdeteksi oleh sensor 1. Lahan parkir yang bagian blind spot terdeteksi oleh sensor, bisa nyatakan secara kuantitatif!!</p>\r\n\r\n<p>Gambar III.2 Skema Rangkaian, resolusi kurang <strong>MOHON DITINGKATKAN, sulit dibaca!!</strong></p>\r\n\r\n<p>Perancangan Algoritma <strong>TIDAK ADA</strong></p>\r\n\r\n<p>menjelaskan bgm fungsi2 yg akan diimplementasikan dituangkan dalam bentuk algoritma.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; Algoritma biasanya berbentuk kata2 atau kalimat.</p>\r\n\r\n<p>Gambar III.7 Realisasi Perangkat Keras, TIDAK JELAS <strong>RESOLUSI KURANG TIDAK DAPAT DIBACA</strong></p>\r\n\r\n<p><strong>PERANCANGAN PCB</strong>: menjelaskan bgm dari skema elektronik menjadi PCB diawali dgn pembuatan Layout berakhir dengan tercetaknya sebuah PCB.<br />\r\n&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; ==&gt; Tunjukkan foto2 terkait. PCB yg digunakan sudah ada/jadi bukan dibuat sendiri !!!</p>\r\n\r\n<p>Gambar IV.1 Server sebelum digunakan <strong>RESOLUSI KURANG</strong></p>\r\n\r\n<p>Parameter yang Diuji, TIDAK DINYATAKAN SECARA JELAS BREAKDOWN NYA BUAT PAKE&nbsp;POINTER</p>\r\n\r\n<p>Data-Data Pengujian,<strong>TIDAK ADA</strong></p>\r\n\r\n<p>Grafik-Grafik Pengujian, <strong>TIDAKADA</strong></p>\r\n\r\n<p>Analisa dan Pembahasan, KURANG MEMADAI <strong>KARENA TIDAK ADA DATA DAN GRAFIK</strong></p>\r\n\r\n<p>Lampiran 4: Tabel Data Prime,<strong>TIDAK ADA</strong></p>', 1, 1, 0, '2019-07-29 03:59:16', '2019-07-29 03:59:16'),
(6, '161331041', 'EE021N', '<p>Bab III, hal 12, III.1.1 : sebelum gambar, ada tulisan/alinea dulu baru bawahnya gambar, begitu juga untuk gambar pada halaman 15, 16, 17, dst</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; hal. 4; spesifikasi teknis yg diinginkan sertakan parameter terukur nya, untuk dibandingkan dan di analisis pada&nbsp; kesimpulan hal.37</p>', 1, 1, 0, '2019-07-22 04:14:24', '2019-07-22 04:14:24'),
(7, '151344003', 'EE021N', '<p>Hal 4 : sebelum gambar 1.1 tambahkan kalimat/alinea, kepala gambar I.2 pindahkan ke hal 4,</p>\r\n\r\n<p>hal 9 ; sambungan tabel II.1 gabung ke hal 8 kepala tabel dibawahnya hilangkan.</p>\r\n\r\n<p>hal 12 : sebelum gambar II.2. hal 20&nbsp; sebelum gambar II.4. juga gambar II.7, gambar II.8, gambar III.1 , gambar III.5, gambar III.17, gambar III.22, dst, cari&nbsp; cari sendiri&nbsp;</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; tambahkan kalimat/alinea;</p>\r\n\r\n<p>Teori Pendukung : tambahkan teori dasar tentang sensor yg digunakan.</p>\r\n\r\n<p>hal 27 dst yang ada tabelnya : Kepala/judul tabel letakan di atas tabel, tabel hal 28, tabel III.3 beri judul diatas tabel tambahkan (lanjutan)</p>\r\n\r\n<p>hal 74 : Kesimpulan, isikan parameter parameter terukur, bandingkan&nbsp; antara spek teknis perancangan dengan hasil/data yang dicapai, analisis</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; perbedaan/kesamaanya.</p>\r\n\r\n<p>Saran : Pengembangan memilah jenis logam, berat/ukuran sampah, daya motor servo.</p>', 1, 1, 0, '2019-07-29 08:08:31', '2019-07-29 08:08:30'),
(8, '161331046', 'EE065N', '<p>Abstrak masih menggunakan kata &quot;akan&quot;.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tidak memberikan informasi tentang isu yang sama yang dikerjakan oleh pihak/orang lain.</p>\r\n\r\n<p>BAB 1</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Kerangka usulan pengusul tidak jelas.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Tulisan dalam satu halaman haruspenuh sebelum pindah halaman,kecuali pindah BAB.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Nama gambar dan Tabelharus diacu dalam tulisan.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-22 05:40:38', '2019-07-22 05:40:38'),
(9, '151344003', 'EE008N', '<p><strong>ABSTRAK:</strong></p>\r\n\r\n<p><strong>JADI YG MAU SDR BUAT DALAM TA INI APAAN ? NYATAKAN SECRA LELAS DAN EKSPLISIT.</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Abstrak harus mengandung:</p>\r\n\r\n<p>1. Isu latar belakang,<br />\r\n2. Karya2 terdahulu terkait isu,<br />\r\n3. Permasalahan-permasalahan yang ditemukan pada karya-karya terdahulu,<br />\r\n4. Usulan solusi yang dikerjakan di TA ini,<br />\r\n5. Uraian metode yang diusulkan, 6. Hasil2 percobaan. Abstrak ditulis dalam 1 alinea berisi 150 sd 250 kata (1/2 sd 3/4 halaman), Font Times New Roman 12, margin kiri 4 cm, atas bawah kanan 3 cm, spasi 1. Catatan: Abstrak harus ditulis Abstrak dan bukan Abstraksi. Abstrak tidak boleh mengandung kata &quot;akan&quot;.</p>\r\n\r\n<p><strong>IKUTI PANDUAN DIATAS.</strong></p>\r\n\r\n<p>Indonesia still has many people who do not yet have the concern to dispose of waste based on.......BETULKAN KALIMAT INI JANGAN BHS IND DIINGGRISKAN , ORANG INGGRIS NGGAK BAKALAN NGERTI!!!!</p>\r\n\r\n<p>HALAMAN PENGESAHAN .............................Error! Bookmark not defined. HALAMAN PERNYATAAN ORISINALITAS.............Error! Bookmark not defined. HALAMAN PERNYATAAN PERSETUJUAN PUBLIKASI..............Error! Bookmark not defined. DAFTAR RIWAYAT HIDUP............................Error! Bookmark not defined. LEMBAR PERSEMBAHAN .............................Error! Bookmark not defined. ABSTRAK............................................................Error! Bookmark not defined. ABSTRACT .........................................................Error! Bookmark not defined. KATA PENGANTAR .........................................Error! Bookmark not defin <strong>BETULKAN !!!</strong></p>\r\n\r\n<p>Tabel III.8. Deskripsi Tampilan User Interface Android...................................... 43 Tabel IV.1. Data Pengujian Output Solar Cell.......Error! Bookmark not defined. Tabel IV.2. Data Pengujian OutputSolar Charge Controller. .....Error! Bookmark not defined. Tabel IV.3. Data Pengujian Output Accu. .............Error! Bookmark not defined.<strong>BETULKAN !!!!</strong></p>\r\n\r\n<p>Lampiran 1 : Datasheet Komponen ...................Error! Bookmark not defined. Lampiran 2 : Skema Lengkap ............................Error! Bookmark not defined. Lampiran 3 : Listing Program............................Error! Bookmark not defined. Lampiran 4 : Tabel Data Primer........................Error! Bookmark not defined. Lampiran 5 : Timeline Tugas Akhir ..................Error! Bookmark not defined.<strong>BETULKAN !!!</strong></p>\r\n\r\n<p><strong>BAB 1:</strong></p>\r\n\r\n<p>permasalahan yg muncul di masyarakat (hrs ada rujukan ke daftar pustaka).</p>\r\n\r\n<p><strong>Tujuan teruku</strong>r :alat/sistem apa yg hendak dibuat. Kaitkan dgn judul unt menjadikan alasan pemilihan judul utama.<br />\r\n&nbsp;&nbsp; ==&gt; luaran yg akan dihasilkan (produk, prototipe, paten, publikasi, dll)<br />\r\nButir2 di atas merupakan janji pengusul yg akan distate capaiannya dan tingkat keberhasilannya dalam bab Kesimpulan).<br />\r\n==&gt; kerangka pemikiran dlm penyelesaian permasalahan tsb (usulan pengusul).Misalnya kandungan sampah organik sekian persen, kandungan ampah non-organik sekian persen</p>\r\n\r\n<p>SPESIFIKASI TEKNIS:&nbsp;Berikan batasan2 &quot;parameter/lingkungan internal&quot; sistem yang membatasi permasalahan agar tdk melebar dan tetap fokus. Contoh untuk sistem Transceiver maka spek teknisnya a.l. daya pancar, sensitivitas, jenis modulasi, dll.JADIHARUS SECARA TEKNIS SEPERTI BERAPA WATT DAYA YANG DIPERLUKAN, BERAIS SAMPAH APA?PA WATT SOLAR CELL YG DIBUTUHKAN, BERAPA TON SAMPAH YANG DAPAT DIKELOLA, JENIS SAMPAH APA? DLL.</p>\r\n\r\n<p><strong>BETULKAN !!!!</strong></p>\r\n\r\n<p>Perancangan Algoritma, <strong>TIDAK ADA !!! MOHON ADAKAN</strong></p>\r\n\r\n<p>Perancangan Diagram Alir,&nbsp;<strong>TIDAK ADA !!! MOHON ADAKAN</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-29 07:48:51', '2019-07-29 07:48:51'),
