(12, '151344019', 'EE021N', '<p>hal1 dst : Ganti alinea spasi tetap.</p>\r\n\r\n<p>hal 14 dst : sebelum gambar tambahkan alinea/kalimat</p>\r\n\r\n<p>hal 39 : Tabel 4.2&nbsp; diberi judul, tambahkan (lanjutan), tabel 4.3 pindah ke hal 40.</p>', 1, 1, 0, '2019-07-30 02:59:34', '2019-07-30 02:59:34'),
(13, '151331050', 'EE021N', '<p>1. hal 7, dst : tabel lanjutan diberi judul dengan ditambah (lanjutan)</p>\r\n\r\n<p>2. hal 13, dst, : sebelum gambar tuliskan alinea/kalimat terlebih dahulu.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; , contoh pada halaman 13, dst, cari sendiri</p>\r\n\r\n<p>3. Abstrak dan kesimpulan diperbaiki, masukan spec alat yg dikehendaki, masukan data hasil yg diperoleh, bandingkan, lalu dianalisis.</p>\r\n\r\n<p>4. Tata tulis laporan diperbaiki, spasi tidak sama, ada yang 1,5 spasi ada yang 1 spasi</p>\r\n\r\n<p>5. Setiap halaman harus penuh dengan tulisan, tidak boleh ada space kosong dibawah, kecuali halaman akhir bab.</p>', 1, 1, 0, '2019-07-30 08:02:58', '2019-07-30 08:02:58'),
(14, '151344021', 'EE008N', '<p><strong>Abstrak:</strong></p>\r\n\r\n<p>&nbsp;Isu latar belakang,<br />\r\n2. Karya2 terdahulu terkait isu,<br />\r\n3. Permasalahan-permasalahan yang ditemukan pada karya-karya terdahulu,</p>\r\n\r\n<p>In this series only the frequency range of 95-100 Mhz is limited, <strong>INI MAKSUDNYA APA YA?</strong></p>\r\n\r\n<p><strong>BAB.1:</strong></p>\r\n\r\n<p><strong>Sekilas Karya/Sistem Terdahulu:</strong></p>\r\n\r\n<p>Disini diberi kata &quot;sekilas&quot; unt mengartikan singkat dan agar tdk overlaping dgn judul sub bab pada tinjauan pustaka.<br />\r\n==&gt; kendala2 teknis elektronik yg ada dlm penyelesaian masalah di atas (hrs ada rujukab ke daftar pustaka).<br />\r\n&nbsp;==&gt; solusi2 teknis elektronik yg sdh ada dlm menghadapi kendala2 tsb di atas (hrs ada rujukan ke daftar pustaka). Ini merupakan resume singkat pustaka2 terkait yg lbh detilnya ada di bab tinjauan pustaka. <strong>KURANG TAJAM PERTAJAM DAN PERLUAS.</strong></p>\r\n\r\n<p><strong>RUANG LINGKUP MASALAH:</strong></p>\r\n\r\n<p>Berikan batasan2 &quot;parameter/lingkungan eksternal&quot; sistem yang membatasi permasalahan agar tdk melebar dan tetap fokus. Contoh untuk sistem Transceiver maka ruang lingkupnya a.l. line of sight, jarak 1000 meter, dll.MIS: DAYA PANCAR, COVERAGE DLL.&nbsp;</p>\r\n\r\n<p><strong>BANYAK HALAMAN KOSONG YA BISA DIBUANG YG KOSONG!</strong></p>\r\n\r\n<p>PADA BAB 2 PUN&nbsp;<strong>BANYAK HALAMAN KOSONG YA BISA DIBUANG YG KOSONG!, BISA DISI TOLONG DIATUR LAY OUTNYA YA!</strong></p>\r\n\r\n<p><strong>II.4 Teknologi Pendukung </strong></p>\r\n\r\n<p><strong>II.4.1 Sistem Penguat Daya RF Kelas C, INI KAYANYA MASIH MASUK TEORI PENDUKUNG BUKAN TEKNOLOGI PENDUKUNG, TEKNOLOGINPENDUKUNG KAMU BISA MASUKAN TEKNOLOGI SIMULASI PEMNCAR ATAU RANGKAIAN AMPLIFIER PEMANCAR.</strong></p>\r\n\r\n<p><strong>SIMULASI :</strong></p>\r\n\r\n<p>menjelaskan bgm memvalidasi suatu rancangan hardware (skema elektronik) atau software (flowchart) menggunakan software simulator sehingga terbukti apa yg telah dirancang sdh tepat perhitungan nilai-nilainya. Bila ternyata hasilnya belum tepat maka menjadi masukkan bagi perbaikan perancangan skematik.<br />\r\n==&gt; menjelaskan kerealistisan, kejelasan dan keterkaitan hubungan antara (Teori dan Praktis) , HASIUL SIMULASI BERUPA APA? HARUSNYA KURVA, GRAFIK ATAU NILAI2 ARUS, TEGANGAN ATAU DAYA DSB. SDR PAKE SOWT WARE APA?</p>\r\n\r\n<p>Gambar IV.5 Kurva linearity pada Frekuensi 95-100 MHz&nbsp; HARUSNYA KURVA GAIN VS FREKUENSI, KITA AKAN PEROLEH GAIN FLATNESS HRS &lt; 1 dB.</p>\r\n\r\n<p>&nbsp;Gambar IV.6 Kurva Input dan Output pada Frekuensi 95-100 MHz, HRSNYA KURVA OUTPUT (dBm) VS INPUT (dBm) KURVA INI AKAN MEMBERIKAN KURVA LINIERITA, I dB COMP POINT DAN INPUT MAKS. (dBm).</p>\r\n\r\n<p>Tingkat pemahaman mahasiswa terhadap materi tugas akhir:</p>\r\n\r\n<p>1. pengamatan terhadap bentuk grafik dan anomalinya.<br />\r\n2.&nbsp;Bandingkan dgn yang dihasilkan di bagian perancangan dan simulasi (bab 3) atau di teori pendukung (bab 2).<br />\r\n3.&nbsp;Sampaikan hasil analisa/pengamatan, bila terdapat perbedaan sampaikan apa perbedaannya.<br />\r\n4. Sampaikan juga apa penyebab perbedaan tsb dan solusi apa yang dapat dipergunakan untuk memperbaikinya.<br />\r\nCatatan: bila solusi tsb masih dapat diterapkan maka kembali lagi ke proses sebelumnya bila sudah tidak mnkn lagi mengingat keterbatasan keilmuan dan waktu maka biarkan menjadi catatan saran pada bagian Kesimpulan dan Saran.<strong>PERBAIKI ANALISA DAN PEMBAHASANNYA</strong></p>', 1, 0, 0, '2019-07-17 14:10:36', '2019-07-17 14:10:36'),
(15, '161331045', 'EE021N', '<p>Abstrak, masukan latar belakang, pemecahan, metoda,&nbsp; sec desain, hasil, ulasan, secara singkat</p>\r\n\r\n<p>Hal.6 : Tabel lanjutan diberi kepala/judul tabel dengan ditambah (lanjutan).</p>\r\n\r\n<p>hal. 16 : harus terisi penuh,</p>\r\n\r\n<p>Kesimpulan : masukkan spec yg dikehendaki, hasil demo, bandingkan, beri ulasan</p>', 1, 1, 0, '2019-07-24 02:31:40', '2019-07-24 02:31:40'),
(16, '161331043', 'EE021N', '<p>hal. xi : Abstrak cantumkan tentang permasalahan, spec teknis yang dikehendaki, data hasil yang dicapai bandingkan dg yg dikehendaki, analisis prbedaan yg ada.</p>\r\n\r\n<p>hal 16, 17, 18, : tabel diberi judul dan nomor tabel.</p>\r\n\r\n<p>hal 22 : diatas gambar III,1 ada alinea/kalimat terlebih dahulu</p>\r\n\r\n<p>hal 26 : harus terisi penuh</p>\r\n\r\n<p>hal 27, 28, : setiap diagram alir diberi nomor dan judul gambar.</p>\r\n\r\n<p>hal 33, 34, 35, 36, 37 : tabel diberi judul dan nomor tabel</p>\r\n\r\n<p>Kesimpulan : berisi spec teknis yg dikehendaki dg besaran/parameter terukur, data hasil pengujian, bandingkan spec. dg hasil, analisis perbedaanya.</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-24 05:07:01', '2019-07-24 05:07:01'),
(17, '161331050', 'EE021N', '<p>hal. 6,7,8,9,10,12, 13,14, dst s/d bab-bab berikutnya : diatas gambar ditulis kalimat/alinea terlebih dahulu, gambar gambar terkait tidak jelas.</p>\r\n\r\n<p>hal. terkait : spasi antar sub bab diubah (terlalu dekat), contoh II.3.4.1 dengan II.3.4.2, dst.</p>\r\n\r\n<p>hal 28, 29, 30 :Tabel pengujian lanjutan diberijudul dan nomor (lanjutan)</p>\r\n\r\n<p>hal 32 : kesimpulan, masukkan spec perancangan, data hasil pengujian, bandingkan, analisis dan tarik kesimpulan, kesimpulan berisi parameter-parameter terukur.</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; misal frekuensi pada spec perancangan sebesar 100 Mhz, hasil pengukuran 102 Mhz, analisis kenapa hal ini terjadi, dst utk parameter yg lain.</p>', 1, 1, 0, '2019-07-24 07:41:51', '2019-07-24 07:41:51'),
