(42, '161331033', 'EE083N', '<p><strong>Abstrak: </strong></p>\r\n\r\n<p><strong>1.&nbsp;</strong>Indonesia merupakan negara maritim dengan lautnya yang mencapai 2/3 dari keseluruhan. ... Ini keseluruhan apa?</p>\r\n\r\n<p>Latar belakang terlalu luas, fokus pada teknologi.</p>\r\n\r\n<p>2. Mayoritas nelayan di Indonesia masih menggunakan cara-cara tradisional dan tanpa teknologi penunjang.: ...Sebutkan cara tradisional itu seperti apa?</p>\r\n\r\n<p>3. tidak ada unsur studi literatur.</p>\r\n\r\n<p>4. mengefisiensikan dan mengefektifkan pola kerja nelayan nelayan. : ....Yang diefisienkan bukan cara kerja nelayan!!!</p>\r\n\r\n<p>5. Mobile Equipment yang ditempatkan untuk. Alat dan sistem ini dapat mengirimkan data-data utama berupa data hasil tangkapan : ...Tidak nyambung</p>\r\n\r\n<p>6. bisa mengefisiensikan dan mengefektifkan pola kerja nelayan nelayan: ... mana di akhir abstrak yang menyatakan dapat &quot;mengefisienkan &quot; sesuai tujuan dibuatnya alat ini?</p>\r\n\r\n<p>Kata kunci: Hanya antara 3-5 kata dan bukan berupa kalimat.</p>\r\n\r\n<p>Abstrak bhs ingris koreksinya sama dengan abstrak bhs indonesia, gramatical perlu diperhatikan!! (Berantakan)</p>\r\n\r\n<p>Kata kunci: Koreksinya sama dengan yg berbahasa Indonesia</p>\r\n\r\n<p>BAB I:</p>\r\n\r\n<p>....ikan [1]. Suhartini, et -al. memperkirakan .... : Ini harvard dan IEEE dicampur!</p>\r\n\r\n<p>BAB II:</p>\r\n\r\n<p>2.3.1 Kelautan Indonesia dan Masyarakat Nelayan .... INI BUKAN TEOrRI pendukung, teori pendukung adalah teori yang mendasari secara keteknikan apa yang saudara kerjakan.</p>\r\n\r\n<p>Bagian teori pendukung perlu diperkaya dengan teori ttg apa yang saudara kerjakan yaitu ttg teori yg mendasari pembuatan alat komunikasi data yang sdr buat.</p>\r\n\r\n<p>Komponen Mikrokontroler dan alat pendukung lainnya BUKAN Teori Pendukung</p>\r\n\r\n<p>BAB V.</p>\r\n\r\n<p>Kesimpulan harus berdasar pada acuan pada bab I yg di analisa dan dibuktikan pada BAB IV, hasil analisa data yg diperoleh, sdr simpulkan pada BAB 5.</p>\r\n\r\n<p>Kesimpulan ke 5 ada baiknya terkuantisasi, tidak hanya normatif</p>\r\n\r\n<p>Kesimpulan no 6 itu bukan kesimpulan, tapi itu fitur.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>BAB III</p>\r\n\r\n<p>Jangan samakan metodologi penelitian dengan Mekanisme penulisan Karya ilmiah, diskusikan dengan pembimbingnya.</p>\r\n\r\n<p>Gambar 3.0.5 Diagram alir Data Hasil Tangkapan Nelayan &lt;+++ Ada kesalahan diskusikan dengan pembimbing.</p>\r\n\r\n<p>Pada bab ini nampak hanya dilakukan simulasi saja, tidak pada kondisi sebenarnya, jika demikian harus diperoleh data sekunder yang dapat mengetahui keberadaan WiFi di lautan, bagaimana dalam kondidi Intermiten, bagaimana dalam konsisi, tdk ada WiFi??? Berpa persen lautan yang sudah ter-cover oleh WiFi. Berpa janghkauan max radio yg digunakan, lalu mengapa hanya 350m, lalu bagaimana bila jarak itu lebi, lalu dengan daya berapa jangkauan itu bisa mengcover lautan. Bila tidak dilakukan pengamatan secara real bisa dilakukan dengan mencari data sekunder, lalu dianalisa dan dibandingkan dengan data primer.</p>\r\n\r\n<p>Jika pengujian baru hingga jarak 193 meter, perlu analisa bila dilakukan lebih dari itu dan bila kurang dari itu. pada situasi sesungguhnya jarak akan jauh lebih besar dari 193 meter, jika seperti ini, analisanya bagaimana?</p>\r\n\r\n<p>Pada saran, perlu disampaikan kemungkinan penelitian berikutnya dengan mengungkap semua kendala yg ditemui di percobaan ini, sehingga peneliti berikutnya tidak akan mengulangi kesalahan yg sama</p>\r\n\r\n<p>Lampiran:</p>\r\n\r\n<p>Perlu pemahaman apa yg dimaksud dengan data primer, karena yg sdr tampilkan itu bukan merupakan data primer.&nbsp;</p>', 1, 1, 0, '2019-07-24 03:25:01', '2019-07-24 03:25:01'),
(43, '161331052', 'EE098N', '<p>Bab 1</p>\r\n\r\n<p>1. Kata kebencanan harus diubah menjadi terjadinya bencana</p>\r\n\r\n<p>2. istilah inggris semuanya jika ingin dibuat italic maka harus seragam</p>\r\n\r\n<p>Bab 3</p>\r\n\r\n<p>1. Rancangan tegangan 5V didapatkan dari mana, pada skema rangkaian tidak jelas karena hanya ditampilkan untuk sumber 12V saja</p>\r\n\r\n<p>Bab 3</p>\r\n\r\n<p>1. Tidak ada ekstraksi dari flowchart menjadi program (tiba-tiba muncul program begitu saja)</p>\r\n\r\n<p>2. Tidak ada ekstraksi desain database menjadi database (tiba-tiba muncul tabel-tabel tanpa menjelaskan kaidah-kaidah yang digunakan)</p>\r\n\r\n<p>Bab 4</p>\r\n\r\n<p>1. Analisa hanya sebagian kecil saja</p>\r\n\r\n<p>Bab 5</p>\r\n\r\n<p>1. Capaian kinerja sistem secara prosentase tidak dimunculkan</p>\r\n\r\n<p>2. saran kurang jelas</p>\r\n\r\n<p>Lampiran</p>\r\n\r\n<p>1. Tabel data primer tidak ada</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-29 07:57:02', '2019-07-29 07:57:02'),
