(52, '151344017', 'EE021N', '<p>hal 10, 12, 14, 15, 16, 21, 30,34,37, 40,42,43,44, 45,48, 54,55,56,59,60,62 ,67,68,69 dst cari sendiri: sebelum gambar tulis kalimat-kalimat/alinea.</p>\r\n\r\n<p>hal 24, 25 : gambar atas diberi judul, gambar bawah diberi judul, misal gb,. atas : (a)..................</p>\r\n\r\n<p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; gb bawah : (b)...............,dst</p>\r\n\r\n<p>hal 64,65,66,70,71,dst cari sendiri : label lanjutan diberi nomor dan judul.</p>\r\n\r\n<p>Kesimpulan; Masukan spec. yg dikehendaki, hasil pengujian, bandingkan keduanya, analisis perbedaanya, simpulkan.</p>', 1, 1, 0, '2019-07-25 03:50:59', '2019-07-25 03:50:59'),
(53, '161331007', 'EE009N', '<p>Perbaiki abstrak. Gunakan tata cara/ aturan penulisan laporan sesuai aturan yang berlaku.</p>\r\n\r\n<p>Perbaiki penulisan keterangan tabel, nomor rumus, ket gambar. buang kata penulis, kata gambar di atasw ini, dll.</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-25 05:14:28', '2019-07-25 05:14:28'),
