(56, '161331051', 'EE031N', '<p>Abstrak harus mengandung:</p>\r\n\r\n<p>1. Isu latar belakang,<br />\r\n2. Karya2 terdahulu terkait isu, ( belum ada )<br />\r\n3. Permasalahan-permasalahan yang ditemukan pada karya-karya terdahulu, (belum ada)<br />\r\n4. Usulan solusi yang dikerjakan di TA ini,<br />\r\n5. Uraian metode yang diusulkan, 6. Hasil2 percobaan.&nbsp;</p>', 1, 1, 0, '2019-07-22 08:59:38', '2019-07-22 08:59:38'),
