(60, '151344006', 'EE007N', '<p>1) kata kunci abstrak versi ind dan ing beda, foto mhs tidak ada</p>\r\n\r\n<p>2) no gambar sebutkan pada narasi gbr 1.1, gbr 1.2 dan yang lain nya</p>\r\n\r\n<p>3) IV.4.4 buat resume hasil pengukuran untuk di bandingkan dengan spek perancangan</p>', 1, 1, 0, '2019-07-30 02:46:42', '2019-07-30 02:46:42'),
(61, '161331032', 'EE021N', '<p>Abstrak : berisi latar belakang, ide pemecahan, metoda, data hasil, sedikit ulasan ttg hasil.</p>\r\n\r\n<p>hl 9, 10, 22, 24,27,28,29,31,32,33,34,35,36,37,38,39,42 dst, cari sendiri yang seperti itu&nbsp; : sebelum gambar tulis dulu kalimat kalimat / alinea.</p>\r\n\r\n<p>Latar belakang masalah :tambahkan ide anda untuk memecahkan latar belakang masalah, bandingkan denga karya terdahulu, apa kelebihan kekuranagn ide anda dibandingkarya terdahulu.</p>\r\n\r\n<p>hal 16,22,23,27 dst, cari sendiri yang seperti itu : perhatikan spasi antar sub bab, jarak antar sub bab spasi terlalu kecil.</p>\r\n\r\n<p>Hal 38,39 : Nama gambar Diagram Alir ? betulkan !!!!</p>\r\n\r\n<p>nomor, judul tabel pada halaman 42,43 tidak jelas.</p>\r\n\r\n<p>Kesimpulan masukan data spec. yg diinginkan, data hasil yang diperoleh, bandingkan, analisis perbedaanya kenapa?</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-26 04:08:24', '2019-07-26 04:08:24'),
(62, '161331029', 'EE021N', '<p>Abstrak : masukan latar belakang, ide pemecahan, metoda yang digunalkan, spec. yg dikehendaki, data hasil TA, bandingkan spec yg dikehendaki dg data hasil TA, beri komentar.</p>\r\n\r\n<p>Daftar isi, daftar tabel, daftar lampiran masih : <strong>&nbsp;Error! Bookmark not defined. </strong></p>\r\n\r\n<p><strong>hal 11, 16, 20, 25, 26,27,28, 30, 31, 32,&nbsp; dst cari sendiri yg terkait&nbsp; : sebelum gambar/tabel tuliskankalimat-kalimat terlebih dahulu/ alinea.</strong></p>\r\n\r\n<p><strong>kesimpulan masukan spec. tg diingikan, data hasil TA, bandingkan, analisis/komentariperbedaanya</strong></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-26 04:08:40', '2019-07-26 04:08:40'),
