(93, '151344015', 'EE083N', '<p>ABSTRAK dan ABSTRACT</p>\r\n\r\n<p>Latar belakang masalah tidak mencerminkan latar belakang dari apa yg sdr tawarkan solusinya. Dalam abstrak sdr tidak mengandung studi literatur, sehingga menjadi kabur posisi penelitian sdr.&nbsp;</p>\r\n\r\n<p>Setelah selesai diimplementasikan, pada hasil pengukuran filter bekerja pada frekuensi 1835 &ndash; 1911 MHz, bandwidth yang didapatkan sebesar 76 MHz, insertion loss sebesar 0,953 dB dan return loss sebesar 25,147 dB.&nbsp; &lt;++++ Ini merupakan kesimpulan sdr di Abstrak, apakah ini merupakan solusi dari latar belakang permasalahan?? Jawabnya TIDAK!!! Perlu kembali belajar membuat abstrak, harap diskusikan dengan pembimbing sdr.</p>\r\n\r\n<p>Kata kunci terlalu banyak dan tidak fokus pada kata yg benar2 penting pada karya tulis sdr dan termuat di abstrak. Perlu memperhatikan grmatical dalam penulisan Abstract.&nbsp;</p>\r\n\r\n<p>BAB I.</p>\r\n\r\n<p>Latar belakang perlu diperbaiki, latar belakang HARUS merupakan permasalahan yg diberikan solusinya oleh sdr, dengan adanya alat yg sdr buat. Jika sdr membuat filter, maka permasalahnnya HARUS kedala apa dengan filtert yang ada sebelumnya, lalu solusi apa yg akan sdr lakukan?? Studi literatur sdr blm tepat, karena sdr tidak membahas ttg kendala dari FILTER yg ada sebelumnya.&nbsp;</p>\r\n\r\n<p>BAB II</p>\r\n\r\n<p>Pembahasan teknologi Pendukung masih belum tepat, sdr harusnya membahas Teknologi FILTER bukan LTE!!</p>\r\n\r\n<p>Penulisan BAB dan SUb Bab diperbaiki. Penulisan nama Gambar dan tabel perlu diperbaiki (Misal: Gambar II.1 seharusnya 2.1 ) dst.</p>\r\n\r\n<p>BAB III</p>\r\n\r\n<p>Dengan telah mendapatkan ukuran lebar saluran yang ditentukan maka nilai konstanta dielekrik efektif dapat didapatkan dengan menggunakan persamaan &lt;++++ Ini salah kamar, tidak seharusnya disini. Pelajari lagi tatacara penulisan TA.</p>\r\n\r\n<p>BAB V.</p>\r\n\r\n<p>Kesimpulan sdr sdh cukup bagus, namun saran sdr tidak tepat. Perlu perbaiki, dengan mengungkap kendala yg sdr hadapi agar peneliti berikutnya tidak terkendala seperti sdr. Perlu pula diperhatikan pengalaman sdr dalam mengungkap data dan menampilkan hasil, lakukan analisa utk masa mendatang perbaikan apa yg masih perlu dilakukan. Itu tulisakan dalam saran.</p>\r\n\r\n<p>Lampiran:Nampak lampiran sdr perlu diperbaiki, lihat panduan penulisan. Yg sdr tampilkan HANYA data primer saja, tanpa penjelasan apapun.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-25 03:11:41', '2019-07-25 03:11:41'),
