(100, '151344002', 'EE083N', '<p>Abstrak:</p>\r\n\r\n<p>Perlu dievaluasi lagi hrs meliputi: Latar belakang. Studiliteratur, posisi penelitan (Solusi yg ditawarkan), realisasi analisis dan hasil analisa</p>\r\n\r\n<p>Konsistensi Antar bab perlu diperhatikan.</p>\r\n\r\n<p>BAB II</p>\r\n\r\n<p>Perlu dievaluasi kembali, keterkaitan antara teori penunjang dengan apa yg sdr kerjakan.</p>\r\n\r\n<p>Metodologi yg diterapkan, cenderung HANYA sistimatika saja. Diskusikan dengan pembimbing.</p>\r\n\r\n<p>IV. Ketajaman analisa yg akan menghasilkan kesimpulan PERLU dilakukan dalam menganalisa data pada bab IV.</p>\r\n\r\n<p>BAB V. Sdr perlu belajar lagi membuat kesimpulan, kesimpulan sdr normatif, perlu terkuantisasi. Diskusikan dengan pembimbing</p>\r\n\r\n<p>Saran saudara juga tidak tepat, berikan saran berdasarkan kendala dan data yg sdr perrolh dari hasil penelitian sdr, jangn hanya normatif, perlu contoh Real.</p>\r\n\r\n<p>Tidak diketemukan:</p>\r\n\r\n<p>1. lampiran yg merupakan data primer</p>\r\n\r\n<p>2. lampiran skema lengkap</p>\r\n\r\n<p>Daftar isi tidak perlu dicantumkan bila tidak digunakan</p>\r\n\r\n<p>Gunakan referensi yang kredibel. SUmber kutipan (Daftar pustaka) perlu diperbaiki</p>', 1, 1, 0, '2019-07-25 05:29:07', '2019-07-25 05:29:07'),
(101, '151344003', 'EE074N', NULL, 1, 1, 0, '2019-07-29 08:08:14', '2019-07-29 08:08:14'),
(102, '151344009', 'EE083N', '<p>ABSTRAK dan ABSTRACt</p>\r\n\r\n<p>Latar belakang masalah tidak sesuai dengan apa yg dikerjakan oleh sdr. Perlu diperbaiki sehingga sejalan dengan solusi yg sdr kerjakan. Tidak nampak analisa yg konprehensif dr hsl realisasi sdr, shg tampilan kesimpulan pada abstrak tidak nampak relefan dengan latar belakang dan solusi yg dikerjakan.&nbsp;</p>\r\n\r\n<p>Lihat hal 35: Gambar 11 dan 12, coba dianalisa! Apakah penjelasan sdr benar? Pelajari lagi dan perbaiki laporan sdr. nampak analisanya blm tepat. Pengertian spliter tidak nampak pada hasil pengamatan sdr.</p>\r\n\r\n<p>Kesimpulan Perlu dipertajam, disesuiakan dengan judul, tujuan yg ingin dicapai dan hasil realisasi dan pengukuran serta analisa hasil pengukuran. Kesimpulan yg sdr tulis semua bukan kesimpulan hasil pengamatan dan analisa, perlu terkuantisasi.</p>\r\n\r\n<p>Kesimpulan disesuaikan dengan hasl realisasi, pengamatan dan analisa, dihubungkan dengan latar blk masalah dan tujuan.</p>\r\n\r\n<p>Lampiran.</p>\r\n\r\n<p>Data primer (Hasil pengukuran dan analisa) perlu ditambahakan dan ada penjelasan sekilas.</p>', 1, 1, 0, '2019-08-01 03:38:59', '2019-08-01 03:38:59'),
(103, '161331032', 'EE083N', '<p>Judul ada baiknya diganti, karena CFC memang sudah tidak digunakan, akan lebih baik, bila ditonjolkan ramah lingkungan itu ditunjukan dengan penggunaan air tsb. Kata 8M3 perlu dihilangkan di judul dan perlu penjelasan mengenai perolehan 8M3.</p>\r\n\r\n<p>ABSTRACT dan ABSTRAK</p>\r\n\r\n<p>Latar belakang perlu diperbaiki, tidak sesuai dengan solusi yg saudara kerjakan.&nbsp;</p>\r\n\r\n<p>Perlu pupa pembatasan cakupan yg jelas sehingga latar belakang tidak menjadi hal yg rancu, sdr harus fokus pada pekerjaan sdr yaitu pada aplikasi android. APA HUBUNGANNYA APLIKASI&nbsp; yg sdr buat dengan pencemaran????&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>BAB I dan BAB II dan III</p>\r\n\r\n<p>Perlu penjelasan cakupan ruangan yg dapat didinginkan, tidak ada penjelasan sama sekali bagaimana menentukan Volume ruangan yang mampu didinginkan, tidak ada data suhu yg dihasilkan dalam ruangan yang sudah ditentukan.</p>\r\n\r\n<p>Tidak ada analisa daya yg digunakan dihubungkan dengan penuruan suhu dalam ruangan yang tertentu. Perlu ditambahkan analisa yg ditabelkan yg merepresentasikan hub suhu dan daya.&nbsp;</p>\r\n\r\n<p>Perlu diperbaiki, terutama yg menyangkut latarbelakang dan teknologi pendukung serta teori pendukung, sama sekali salah kaprah. Konsultasikan dengan pembimbing, Sdr harus fokus pada pekerjaan sdr membuat Software aplikasi.&nbsp;</p>\r\n\r\n<p>Kesimpulan</p>\r\n\r\n<p>Kesimpulan 2 dan 3 tidak relevan. Perlu dikaji lagi dan diperbaiki disesuaikan dengan judul, tujuan, batasan masalah, hasil pengukuran dan analisa rangkaian/data yg diperoleh dari percobaan sdr.</p>', 1, 1, 0, '2019-07-26 04:21:42', '2019-07-26 04:21:42'),
(104, '161331003', 'EE092N', '<p>lihat revisi di hardcopy buku laporan, susah di detaikan secara tertulis disini karena menyangkut beberapa halaman revisi yg berbeda-beda</p>', 1, 1, 0, '2019-07-22 03:42:03', '2019-07-22 03:42:03'),
(105, '161331009', 'EE074N', NULL, 1, 1, 0, '2019-07-29 05:02:53', '2019-07-29 05:02:53'),
(106, '161331053', 'EE075N', '<p>Kata Sistem monitoring di Judul masih bersifat umum belum terlalu spesifik. Sebaiknya dijelaskan di judul apa yang dimonitoring tegangan, arus, level air akinya, dsb.</p>\r\n\r\n<p>Di abstrak belum dijelaskan bagaimana cara/&nbsp;metode mengukur tegangan dan arus untuk monitoring. Tiba-tiba muncul dikata kunci sensor arus dan sensor tegangan sementara kata sensor arus atau tegangan tidak muncul di abstrak.</p>\r\n\r\n<p>Kata kunci aki motor yang ada di judul malah tidak muncul&nbsp;</p>\r\n\r\n<p>Judul Tiap BAB harusnya muncul di DAFTAR ISI</p>\r\n\r\n<p>Bedakan Skematik Diagram dan Wiring Diagram</p>\r\n\r\n<p>Perbaiki diagram blok rancangan</p>', 0, 1, 0, '2019-07-29 08:51:04', '2019-07-29 08:51:04'),
(107, '161331029', 'EE083N', '<p>Judul ada baiknya diganti, karena CFC memang sudah tidak digunakan, akan lebih baik, bila ditonjolkan ramah lingkungan itu ditunjukan dengan penggunaan air tsb.</p>\r\n\r\n<p>ABSTRACT dan ABSTRAK</p>\r\n\r\n<p>Latar belakang perlu diperbaiki, tidak sesuai dengan solusi yg saudara kerjakan.&nbsp;</p>\r\n\r\n<p>Perlu pupa pembatasan cakupan yg jelas sehingga latar belakang tidak menjadi hal yg rancu, sdr harus fokus pada pekerjaan sdr yaitu pada aplikasi android. APA HUBUNGANNYA APLIKASI&nbsp; yg sdr buat dengan pencemaran????&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>BAB I dan BAB II dan III</p>\r\n\r\n<p>Perlu penjelasan cakupan ruangan yg dapat didinginkan, tidak ada penjelasan sama sekali bagaimana menentukan Volume ruangan yang mampu didinginkan, tidak ada data suhu yg dihasilkan dalam ruangan yang sudah ditentukan.</p>\r\n\r\n<p>Tidak ada analisa daya yg digunakan dihubungkan dengan penuruan suhu dalam ruangan yang tertentu. Perlu ditambahkan analisa yg ditabelkan yg merepresentasikan hub suhu dan daya.&nbsp;</p>\r\n\r\n<p>Perlu diperbaiki, terutama yg menyangkut latarbelakang dan teknologi pendukung serta teori pendukung, sama sekali salah kaprah. Konsultasikan dengan pembimbing, Sdr harus fokus pada pekerjaan sdr membuat Software aplikasi.&nbsp;</p>\r\n\r\n<p>Kesimpulan</p>\r\n\r\n<p>Kesimpulan 2 dan 3 tidak relevan. Perlu dikaji lagi dan diperbaiki disesuaikan dengan judul, tujuan, batasan masalah, hasil pengukuran dan analisa rangkaian/data yg diperoleh dari percobaan sdr.</p>', 1, 1, 0, '2019-07-26 04:21:23', '2019-07-26 04:21:23'),
(108, '161331016', 'EE092N', '<p>bagian yang direvisi dapat dilihat di hardcopy buku laporan TA</p>', 1, 1, 0, '2019-07-22 05:18:02', '2019-07-22 05:18:02'),
(109, '151344004', 'EE092N', '<p>masih ada error di daftar isi,</p>\r\n\r\n<p>runtuk revisi lihat hardcopy laporan TA</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-22 08:22:45', '2019-07-22 08:22:45'),
(110, '151344016', 'EE098N', '<p>1. Skema elektronik diperbesar dan diperjelas untuk mempermudah pembaca dalam memahami cara kerja rangkaian</p>\r\n\r\n<p>2. diagramalir sebaiknya dibuat ulang dan diperbesar</p>\r\n\r\n<p>3.Referensi dan keterangan gambar pada label keanggotaan suhu dan kelembaban tidak ada serta gambar-gambar selanjutnya</p>\r\n\r\n<p>4. Gambar listing program sebaiknya lebih diperbesar atau dicuplik secara proporsional untuk tetap mengedepankan kejelasan bagi pembaca</p>\r\n\r\n<p>5. Realisasi database sebaiknya diawali dengan perancangannya</p>\r\n\r\n<p>6. Validasi data pengukuran sebaiknya ditunjukkan pada lampiran agar tidak dianggap sebagai asumsi saja</p>\r\n\r\n<p>7. kesimpulan performance sistem sebaiknya dalam bentuk kuantitatif</p>', 1, 0, 0, '2019-07-26 02:01:08', '2019-07-26 02:01:08'),
(111, '151344022', 'EE092N', '<p>Daftar isi tidak ada di softfile, jadi tdk bisa diverifikasi</p>\r\n\r\n<p>lihat catatan revisi d hardcopy laporan TA</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-30 07:55:11', '2019-07-30 07:55:11'),
(112, '161331035', 'EE098N', '<p>1. Analisa terlalu singkat</p>\r\n\r\n<p>2. Perancangan diperbaiki, baik hardware atau pun software</p>\r\n\r\n<p>3. Perbaiki kesimpulan karena kesimpulan bukanlah pernyataan desain atau teori</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-31 05:42:34', '2019-07-31 05:42:34'),
(113, '161331024', 'EE098N', '<p>Prosentase performance sebaiknya ditampilkan untuk menunjukkan capaian keberhasilan</p>', 1, 1, 0, '2019-07-25 03:05:53', '2019-07-25 03:05:53'),
(114, '161331001', 'EE098N', '<p>1. Keluaran ADC sebaiknya dijelaskan satuannya untuk mempermudah pemahaman dalam kaitannya dengan konversi data</p>\r\n\r\n<p>2. Performance sistem sebaiknya disampaikan secara kuantitatif untuk menghindarkan kesimpulan berdasarkan asumsi</p>\r\n\r\n<p>3. Saran sebaiknya disampaikan secara teknis sehingga kelanjutan pengembangan sistem dapat terlaksana dengan baik</p>', 1, 1, 0, '2019-07-24 08:12:47', '2019-07-24 08:12:47'),
(115, '151344022', 'EE098N', '<p>1. Analisa terlalu singkat</p>\r\n\r\n<p>2. Saran tidak jelas, jika dikaitkan dengan pengembangan kedepan</p>', 0, 1, 0, '2019-07-30 08:02:39', '2019-07-30 08:02:39'),
(116, '161331051', 'EE091N', '<p>1. Tambahkan metoda dan hasil penelitian pada abstrak, krn baru ada latar</p>\r\n\r\n<p>2. Kata kunci kurang tepat : kemiskinan dan teknologi bukan kata kunci yang pas. Mungkin raskin bisa menjadi kata kunci</p>\r\n\r\n<p>BAB 1 :&nbsp;</p>\r\n\r\n<p>Latar : Belum dibahas solusi, tiba2 terdapat kata &quot;alat ini&quot;,&nbsp;</p>\r\n\r\n<p>Sistem Terdahulu : budi aji, jangan dg huruf kecil</p>\r\n\r\n<p>Tujuan Terukur : menambahkan akses apa?&nbsp;</p>', 1, 1, 0, '2019-07-22 08:56:23', '2019-07-22 08:56:23'),
(117, '161331062', 'EE091N', '<p>Hasil penelitian bisa diambil nilai kwantitasnya</p>\r\n\r\n<p>mungkin kata kunci keypad bisa diganti dengan metoda yang digunakan untuk mengolah keypad.</p>\r\n\r\n<p>BAB 1 :</p>\r\n\r\n<p>Latar belakang masalah :</p>\r\n\r\n<p>1 Tinjau ulang pernyataan tentang massa jenis udara terhadap massa jenis air</p>\r\n\r\n<p>2. Penyelesaian masalahnya belum jelas, kaitkan dengan teknologi yang telah dimunculkan oleh penulis</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-30 02:52:27', '2019-07-30 02:52:27'),
(118, '161331043', 'EE092N', '<p>daftar lampiran blm otomatis nge-link ke tabel lampiran</p>\r\n\r\n<p>lihat catatan revisi di hardcopy laporan TA, krn detail revisi sulit presentasikan di sini</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-24 05:04:45', '2019-07-24 05:04:45'),
(119, '161331031', 'EE092N', '<p>masih ada tulisan error di daftar isi (error! bookmark not difined), daftar pustaka, Daft Gambar, Daft Tabel, Daft lampiran blm nge-link</p>\r\n\r\n<p>Latar belakang masih umum dan tidak merujuk mengapa topik ini sangat tepat untuk dianggak sebagai topik TA</p>\r\n\r\n<p>Robot ini membersihkan debu atau membersihkan lantai, karena di ilustrasi gambar 1.1 membersihkan debu, sedangkan di penjelasan-penjelasna membersihkan lantai?</p>\r\n\r\n<p>Gambar 3.1 hal 27 itu bukan blok diagram,&nbsp;</p>\r\n\r\n<p>Kesimpulan belum sinkron dengan tujuan dan belum dapat mengambarkan tingkat keberhasilan atau kemampuan robot pembersih lantai</p>\r\n\r\n<p>Revisi lengkap dapat dilihat pada hardcopy laporan TA</p>', 1, 0, 0, '2019-07-21 01:15:08', '2019-07-21 01:15:08'),
(120, '151344025', 'EE092N', '<p>kata kunci, setiap kata&nbsp;tdk terdiri dari beberapa kata, contoh &quot;komunikasi cahaya tampak&quot; ini terdiri dari unsur 3 kata</p>\r\n\r\n<p>beberapa bagian pada daft tabel belum nge-link</p>\r\n\r\n<p>lihat revisi di hardcopy, karena beberapa detail revisi terdapat pada halaman2 yg terpisah dan sulit ditulis/dinyatakan disini&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-25 04:50:30', '2019-07-25 04:50:30'),
(121, '161331030', 'EE065N', '<p>Abstrak:</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;1. Sebaiknya kalimat dalam abstrak jangan terlalu banyak &#39;kata&#39; bahkan disini jumlah dalam 1 kalimat lebih dari 20 kata.</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-30 08:17:07', '2019-07-30 08:17:07'),
(122, '161331039', 'EE091N', '<p>Hasil belum dimasukkan ke abstrak</p>\r\n\r\n<p>kata kunci belum relevan</p>', 1, 1, 0, '2019-07-30 05:43:11', '2019-07-30 05:43:11'),
(123, '161331048', 'EE091N', '<p>Kenapa abstrak sama persis dengan abstrak Bagas?</p>\r\n\r\n<p>Pendahuluan juga sama, terlalu banyak bagian yang sama</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-30 05:41:51', '2019-07-30 05:41:51'),
