(125, '161331021', 'EE098N', '<p>Performance sistem sebaiknya disampaikan dalam benuk prosentase, untuk mempermudah pemahaman terhadap pencapaian sistem yang dibuat&nbsp;</p>', 1, 1, 0, '2019-07-30 05:03:52', '2019-07-30 05:03:52'),
