(127, '161331023', 'EE098N', '<p>Performance sistem sebaiknya ditampilkan dalam bentuk prosentase untuk mempermudah pemahaman dalam capaian kinerja sistem</p>', 1, 1, 0, '2019-07-30 05:02:52', '2019-07-30 05:02:52'),
(128, '161331036', 'EE092N', '<p>masih ada &quot; error! bookmark not defined &quot; di daftar isi dan daftar lampiran</p>\r\n\r\n<p>revisi laporan dapat dilihat pada hardcopy laporan TA</p>', 1, 1, 0, '2019-08-01 02:38:18', '2019-08-01 02:38:18'),
(129, '151344017', 'EE092N', '<p>Daftar isi, daftar tabel, daftar&nbsp;gambar, daftar&nbsp;lampiran belum nge-link secara otomatis</p>\r\n\r\n<p>revisi dapat dilihat pada hardcopy laporan TA</p>', 1, 1, 0, '2019-07-25 05:19:17', '2019-07-25 05:19:17'),
(130, '161331017', 'EE092N', NULL, 1, 0, 0, '2019-07-21 12:18:15', '2019-07-21 12:18:15'),
(131, '161331061', 'EE092N', '<p>Kata kunci tidak terdiri dari banyak suku kata contohnya&quot; Short Time Fourier Transform&quot; ini merupakan 4 suku kata</p>\r\n\r\n<p>Daftar isi, daftar tabel, daftar gambar masih terdapat &quot;error! bookmark not defined &nbsp;dan belum nge- link</p>\r\n\r\n<p>tidak ada daftar lampiran</p>\r\n\r\n<p>bagian revisi lengkap dapat dilihat pada hardcopy laporan TA</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-26 04:33:42', '2019-07-26 04:33:42'),
(132, '151344029', 'EE092N', '<p>kata kunci biasanya terdiri dari satu suku kata bukan beberpa suku kata contoh, &quot; Binary Frequency Shift Keying&quot; ini memuat 4 suku kata</p>\r\n\r\n<p>Daftar isi daftar lampiran masih &quot; error! bookmark not defined &quot; dan belum nge-link</p>\r\n\r\n<p>Gambaran pelaksanaan pengujian sub bab IV.1.3&nbsp;hal 60 lebih tepat jika disamapaika dalam sub bab parameter pengujian, karena isi sub bab pelaksanaan pengujian lebih merujuk ke bagaimana cara melaksanakan pengujian bukan menyampaikan jenis-jenis pengujian</p>\r\n\r\n<p>inti &nbsp;pokok yg dibahas di kesimpulan adalah tentang tingkat keberhasilan pengujian alat &nbsp;di dalam air sesuai dengan tujuan, justru bagian ini yang belum tersimpulkan&nbsp;</p>\r\n\r\n<p>Revisi lengkap dapat dilihat pada hardcopy laporan TA</p>\r\n\r\n<p>&nbsp;</p>', 1, 1, 0, '2019-07-26 07:47:39', '2019-07-26 07:47:39'),
(133, '161331009', 'EE092N', NULL, 1, 1, 0, '2019-07-29 05:07:20', '2019-07-29 05:07:20'),
(134, '161331037', 'EE090N', '<p>Pada Abstrak.</p>\r\n\r\n<p>1. Kata kontroling itu tidak ada dalam bahasa Indonesia, jadi harus diganti dengan kata &quot;proses pengaturan&quot;, diketik dengan spasi :&nbsp;mikrokontroller Node MCU.</p>\r\n\r\n<p>2. Di akhir abstrak, lengkapi dengan data pengujian atau data analitik.</p>\r\n\r\n<p>3. Pada baris ke-4, setelah kata &quot;terjaga&quot;, jangan titik, tetapi ganti menjadi koma, lalu disambung kalimat berikutnya dengan &quot; yang mana kondisi ini&nbsp;tidak boleh kurang dari batas minimal dan tidak boleh lebih dari batas maksimal.&nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>Pada Bab. 1</p>\r\n\r\n<p>1. Cek kembali kesalahan pengetikan. Contoh :&nbsp;ketellitan,&nbsp;menapmpilkan</p>\r\n\r\n<p>2. Ada penempatan awal paragraf yang tidak tepat, termasuk penempatan awal kalimat yang tidak tepat.</p>\r\n\r\n<p>3. Ada penulisan/pemakaian kata tidak tepat, contoh : me-monitoring, kata ini bisa diganti dengan mengamati/melakukan pengamatan, inputan bisa diganti&nbsp;input.&nbsp; Nodemcu diberi spasi.</p>\r\n\r\n<p>4. Ada kalimat tanpa penempatan tanda baca &quot;titik&quot;.</p>\r\n\r\n<p>5. Penulisan yang benar &quot;Gambar 2.1 bukan gambar 2.1. Cek di Bab-bab yang lain.</p>\r\n\r\n<p>Pada Bab 2-5 :</p>\r\n\r\n<p>1. Typo : yangn,&nbsp;me-monitoring,&nbsp;pernagkat, Untuk Permasalahan di atas, P huruf kecil seharusnya&nbsp;</p>\r\n\r\n<p>2. Istilah asing : miring.&nbsp;</p>', 1, 1, 0, '2019-07-22 02:31:51', '2019-07-22 02:31:51'),
(135, '161331041', 'EE090N', NULL, 1, 1, 0, '2019-07-22 04:35:27', '2019-07-22 04:35:27'),
(136, '161331051', 'EE098N', '<p>1. Analisa sebaiknya dibedakan dengan pembahasan cara kerja, analisa lebih mengarahkan kepada system performance dibandingkan dengan capaian yang ingin dicapai (sesuai penentuan spesifikasi dan luaran yang ignin dicapai)</p>\r\n\r\n<p>2. Kesimpulan adalah hasil keseluruhan dari system performance</p>\r\n\r\n<p>3. saran sebaiknya lebih jelas mengarah kepada kendala-kendala teknis yang dihadapi serta prediksi solusi yang harus dikembangkan atau diubah atau dihindari &nbsp;</p>', 1, 1, 0, '2019-07-22 08:57:22', '2019-07-22 08:57:22'),
(137, '161331034', 'EE098N', '<p>1.sub bab pembahasan sebaiknya dilengkapi</p>\r\n\r\n<p>2. Analisa harus dijelaskan untuk menggambaran kondisi peracangan dibandingkan dengan hasil atau realisasi alat tau sistem</p>\r\n\r\n<p>3. kesimpulan diambil dari hasil analisa setiap percobaan yang disimpulkan secara global</p>\r\n\r\n<p>4. saran ditujukan untuk perbaikan pengembangan kedepan sehingga kendala teknis menjadi landasan saat menjelaskan saran, pada saran saudara terkesan tidak jelas karena munculnya saran tidak dijelaskan berdasarkan permasalahan yang dihadapi</p>\r\n\r\n<p>5. perbaiki keterkaitan antar dan intra bab untuk memperjelas pembaca dalam mengurutkan pembahasan dari setiap bab</p>', 1, 1, 0, '2019-07-22 06:18:14', '2019-07-22 06:18:14'),
(138, '151344011', 'EE098N', '<p>1.Gambar sistem tidak jelas karena terlalu kecil</p>\r\n\r\n<p>2.Realisasi program sebaiknya dibuat disesuaikan dengan flowchartnya baik secara sistem maupun sub sistem</p>\r\n\r\n<p>3.Analisa sebaiknya dijelaskan per pengujian sehingga akan sangat mudah memahami setiap proses pelaksanaan pengujian</p>\r\n\r\n<p>4. Pada bagian saran, maksud dari identifikasi dengan pengenalan apa bedanya?</p>\r\n\r\n<p>5. Saran sebaiknya dijelaskan berdasarkan kendala-kendala yang dihadapi saat pengujian dan prediksi sementara atas solusi yang memungkinkan untuk dikembangkan atau ditingkatkan</p>', 1, 0, 0, '2019-07-21 23:32:59', '2019-07-21 23:32:59'),
