(208, '161331047', 'EE056N', '<p>Dasar Teori tambahkan Sistem Linear open loop dan closed loop.<br />\r\nPerbaiki kata <em>monitoring</em> menjadi pemantauan.<br />\r\n<em>Wiring </em>di gambar perlu dirapihkan. Sumbu horizontal dan vertikal pada Grafik menunjukkan apa?<br />\r\nmisal nama grafik &quot;Grafik Pengujian Sensitivitas Sensor Api&quot;</p>\r\n\r\n<p>Di saran ditambahkan;<br />\r\n1. Perlu mengoptimalkan delay antara data yang diterima dengan action serta alarm yang dihasilkan.<br />\r\n2. Perlu pengaturan kapan alat tersebut perlu dinyalakan atau tidak, untuk penghematan</p>', 0, 1, 0, '2019-07-25 05:16:16', '2019-07-25 05:16:16'),
