(218, '151344016', 'EE089N', '<p>2. Karya2 terdahulu terkait isu,<br />\r\n3. Permasalahan-permasalahan yang ditemukan pada karya-karya terdahulu,<br />\r\n4. Usulan solusi yang dikerjakan di TA ini,<br />\r\n5. Uraian metode yang diusulkan, 6. Hasil2 percobaan. Abstrak ditulis dalam 1 alinia berisi 150 sd 250 kata (1/2 sd 3/4 halaman), Font Times New Roman 12, margin kiri 4 cm, atas bawah kanan 3 cm, spasi 1.</p>\r\n\r\n<p>Spek Teknis</p>\r\n\r\n<p>==&gt; Berikan batasan2 &quot;parameter/lingkungan internal&quot; sistem yang membatasi permasalahan agar tdk melebar dan tetap fokus. Contoh untuk sistem Transceiver maka spek teknisnya a.l. daya pancar, sensitivitas, jenis modulasi, dll.<br />\r\nBerikan pertimbangan2 unt setiap parameter yg dimunculkan dan nilainya dikaitkan dgn permasalahan2 dan kelemahan solusi2 yg telah dibahas di atas.<br />\r\nButir2 di atas merupakan janji pengusul yg akan distate capaiannya dan tingkat keberhasilannya dalam bab Kesimpulan).</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 1, 0, 0, '2019-07-26 02:00:30', '2019-07-26 02:00:30'),
(219, '151344016', 'EE090N', '<p>Perhatikan kaidah tata penulisan yang benar, ada nama kota atau daerah huruf kecil, ada yg seharusnya huruf pertama tidak perlu pakai huruf kapital malah pakai huruf kapital. Tidak ada kata mengestimasi, ganti dengan kata memperkirakan atau memprediksi.</p>\r\n\r\n<p>Banyak kesalahan pengetikan.</p>\r\n\r\n<p>Pada sub bab, sebelum masuk gambar sebaiknya ada paparan/narasi.</p>', 1, 0, 0, '2019-07-26 02:01:28', '2019-07-26 02:01:28'),
