(244, '161331042', 'EE021N', '<p>hal 8, dst : tabel harus ad judul no: Tabel 1 ...... (lanjutan)</p>\r\n\r\n<p>hal 11, dst : gambar ditaruh dibwah alinea (sebelum gambar ada alinea)</p>', 1, 1, 0, '2019-07-26 08:20:55', '2019-07-26 08:20:55'),
