(246, '161331042', 'EE075N', NULL, 1, 1, 0, '2019-07-26 08:28:37', '2019-07-26 08:28:37'),
(247, '151344010', 'EE090N', '<p>1. Abstrak di buku tugas akhir Anda seperti abstrak sebuah proposal, tolong diperbaiki. &nbsp;</p>\r\n\r\n<p>2. Kata kunci pada abstrak : IoT terlalu umum&nbsp; &nbsp;</p>\r\n\r\n<p>3. Daftar lampiran error bookmark.</p>\r\n\r\n<p>Bab 1. Ganti kata&nbsp;ditaruh menjadi diletakan.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Hati-hati dengan kesalahan pengetikan, seperti kata &#39;gambari&#39;,&nbsp;menggunakna</p>\r\n\r\n<p>Bab. 2.&nbsp; Sebaiknya teori dasar tentang Algoritma Shift dan turunannya ditulis ulang menggunakan bahasa sendiri, tidak menyadur dari sumber web atau sumber&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; online seutuhnya.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Istilah asing diketik miring secara konsisten.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Setelah judul sub bab, jangan langsung gambar, tapi berilah kalimat pengantar tentang gambar. Sebagai contoh pada sub bab II.4. dan kebawahnya.</p>\r\n\r\n<p>Bab III.&nbsp; Penulisan gambar, seharusnya : Gambar 2.1&nbsp;</p>\r\n\r\n<p>Bab III. Sama seperti pada Bab II, setelah judul sub bab jangan langsung gambar, tapi diberi narasi dulu.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;Gambar III.2. Rangkaian skema elektronik, diberi anak panah yang menunjukan alur proses.&nbsp;</p>\r\n\r\n<p>Bab IV. Langkah pengujian menggunakan kalimat aktif bukan kalimat perintah : seperti : atur diganti dengan mengatur.</p>\r\n\r\n<p>&nbsp;</p>', 1, 0, 0, '2019-07-28 12:33:38', '2019-07-28 12:33:38'),
(248, '161331053', 'EE090N', '<p>Abstrak :&nbsp; &nbsp;Dibuat ringkas tapi maksudnya tersampaikan. Kata kunci jangan menggunakan istilah umum seperti SMS, Bluetooth.</p>\r\n\r\n<p>Tidak ada Daftar Lampiran</p>\r\n\r\n<p>Bab I : ada margin kanan yang tidak sama dengan margin kanan di bagian lain.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;tidak ada kata &quot;memonitoring&quot;, kata ini bisa diganti dengan &quot;melakukan pemantauan&quot;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Istilah asing konsisten ditulis italic/miring</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Sistem yang diusulkan pada proyek ini , kata proyek ini diganti dengan proyek akhir.</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Pustaka terkait tidak ada eksplorasi kelemahan atau kelebihan karya terdahulu, sebaiknya ada.</p>\r\n\r\n<p>Bab II dan Bab III, setelah judul sub bab, sebaiknya jangan langsung gambar, tapi tambahkan narasi.&nbsp;</p>\r\n\r\n<p>Parhatikan mana yang penulisan awal hurufnya harus huruf kapital mana yang tidak&nbsp;</p>\r\n\r\n<p>Penulisan persamaan matematik, tanda &quot;kali&quot; atau perkalian jangan menggunakan tanda bintang (*) tapi gunakan tanda kali pada mathematic equation</p>\r\n\r\n<p>Tidak ada nomor halaman</p>\r\n\r\n<p>Bab IV .&nbsp; &nbsp;Ada kalimat &quot;Percobaan sub sistem keempat pengiriman notifikasi SMS ke Android. (belum Rampung)&quot;? apa ini maksudnya</p>\r\n\r\n<p>Penulisan Kesimpulan dalam bentuk narasi, bukan pointer. Rapihkan penulisan kesimpulan.</p>\r\n\r\n<p>Tidak ada lampiran</p>\r\n\r\n<p>Daftar lampiran error bookmark</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp; &nbsp; &nbsp; &nbsp;</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>&nbsp;</p>', 0, 1, 0, '2019-07-29 08:51:45', '2019-07-29 08:51:45'),
